import React from "react";
import "./Project.css";

let Project = () => {
  return (
    <>
      <div className="project-container">
        <div className="project-child">
          <div className="project-img">
            <img src="" alt="project-img"/>
          </div>
          <div className="project-content"></div>
        </div>

        <div className="project-child">
          <div className="project-content"></div>
          <img src="" alt="project-img"/>
        </div>
      </div>
    </>
  );
};
export default Project;
